import "./Home.css";
function Home() {
  return (
    <div className="head">
      <button className="button">Login</button>
      <button className="button">Signup</button>
      <br />
      {/* <div className="body"> */}
        Email ID : <input type="text" /><br />
        Password : <input type="password" /><br />
        <button type="submit">Login</button>
      {/* </div> */}
    </div>
  );
}

export default Home;
